import React from "react";

const Repo = ({ repo }) => {
  const { name, html_url, description, language } = repo;
  return (
    <div className="repo">
      <h3>
        <a href={html_url}>{name}</a>
      </h3>
      <p>{description}</p>
      {language && <h5> {language}</h5>}
    </div>
  );
};

export default Repo;
